/* jshint indent: 2 */

module.exports = function(sequelize, DataTypes) {
  return sequelize.define('csid', {
    id: {
      type: DataTypes.INTEGER(11),
      allowNull: false,
      primaryKey: true,
      autoIncrement: true
    },
    org_id: {
      type: DataTypes.INTEGER(11),
      allowNull: true
    },
    le_id: {
      type: DataTypes.INTEGER(11),
      allowNull: true
    }
  }, {
    tableName: 'csid'
  });
};
